import React, { Component } from "react";
export default class Signup extends Component {
  render() {
    return (
      <div>
           <main role="main" className="inner cover">
                <h1 className="cover-heading">Sign Up</h1>
                <div></div>
                <div class="col-md-6" data-toggle="dropdown">
                     <ul className="dropdown-menu col-xs-12" role="menu" aria-labelledby="dLabel">
                     <li>Admin</li>
                     <li>Teacher</li>
                     <li>Student</li>
                     <li>Parent</li>
                     </ul>
                </div>
                </main>
      </div>
    );
  }
}
